import {BASE_URL, alertDelete, showDialogErrorDeleted, showDialogSuccessDeleted,redirectOnError, showDialogError} from "./main.js";
$(document).ready(function () {
    setTimeout(function () {
        $("#inputPasswordUser").val('');
        $("#inputPasswordUser").attr('placeholder', 'Ketik untuk merubah (biarkan blank jika password tidak ingin diupdate)');
        $("#inputPasswordUser2").val('');
        $("#inputPasswordUser2").attr('placeholder', 'Konfirmasi perubahan password');
    }, 1000);
});

$(function () {
    $('.select2').select2();
    let cardHeaderHeight = $('.card-header').height();
    let cardFooterHeight = $('.card-footer').height();
    let navbarHeight = $('.navbar').height();
    let footerHeight = $('footer').height();
    $('#user-table').DataTable({
        processing: true,
        serverSide: true,
        scrollX: true,
        scrollY: (document.documentElement.clientHeight - cardHeaderHeight) - (navbarHeight - footerHeight) - cardFooterHeight,
        scrollCollapse: true,
        order: [],
        initComplete: function (settings, json) {
            $('#user-table_info').replaceAll($('#info'));
            $('.shimmer').fadeOut(100);
        },
        ajax: {
            url: BASE_URL + 'user/data',
            type: 'post',
            error: function (err) {
                showDialogError('Request Failed');
                //redirectOnError(BASE_URL + "data/data_dil/")
            },
        },
        drawCallback: function () {
            let info = $('.dataTables_info').text();
            $('#user-table_paginate').css('display', '');
            $('#user-table_paginate').replaceAll($('#page'));
        },
        columnDefs: [
            {
                targets: [0,6,9],
                orderable: false
            },
            {
                targets: 9,
                render: function (row, type, data, meta) {
                    return `
                        <a class="text-secondary" href="` + BASE_URL + 'user/update/' + data[7] + `">
                             <i class="fas fa-pen"></i>
                         </a>
                         <a onclick="return confirm('Are you sure?')" href="` + BASE_URL + 'user/delete?delete_id=' + data[7] + `" class="text-secondary">
                            <i class="fas fa-trash"></i>
                        </a>`;
                }
            },
            {
                targets: 7,
                render: function (row, type, data, meta) {
                    return '<span class="badge badge-pill badge-dark text-white">'+data[9]+'</span>';
                }
            },
            {
                targets: 8,
                render: function (row, type, data, meta) {
                    return '<span class="badge badge-pill badge-info text-white">'+data[10]+'</span>';
                }
            },
            {
                targets: 6,
                render: function (row, type, data, meta) {
                    $(row).addClass('text-center');
                    if (parseInt(data[6]) === 1) {
                        return `<span class="badge badge-pill badge-success text-white">Active</span>`;
                    } else {
                        return '<span class="badge badge-pill badge-danger text-white">Inactive</span>';
                    }
                }
            }
        ],
        createdRow: function (row, data, index) {
            $(row).addClass('changeItem');
            $(row).css('cursor', 'pointer');
            $(row).on('click', function () {
                $(this).addClass('selected').siblings().removeClass("selected");
                document.location.href = BASE_URL + 'user/update/' + data[7];
            })
        }
    });
    $('#user-table tbody').addClass('member');

    $('#error-table').DataTable({
        processing: true,
        serverSide: true,
        scrollX: true,
        scrollY: true,
        order: [],
        ajax: {
            url: BASE_URL + 'user/error_data',
            type: 'post',
        },
        columnDefs: [
            {
                targets: 0,
                orderable : false
            },
            {
                targets: 1,
                render: function (row, type, data, meta) {
                    return `
                            <span style="line-height: 0.8em;" data-placement='bottom' class='text-sm text-truncate text-limit-450'
                            class="">
                                <br>`+data[1]+`<br>
                            </span>`;
                }
            },
        ],
        createdRow: function (row, data, index) {
            $(row).addClass('changeItem');
            $(row).css('cursor', 'pointer');
            $(row).on('click', function () {
                $(this).addClass('selected').siblings().removeClass("selected");
                $('#_message').html(data[1]);
                $('#_id').html(data[2]);
                $('#_date').html(data[3]);

                $('#delete_error').click(function () {
                    $('#show-error').modal('hide');
                    Swal.fire(alertDelete).then((result) => {
                        $('#transaction-body-modal').addClass('loading-mask');
                        if (result.value) {
                            $.ajax({
                                url: BASE_URL + 'user/delete_error/' + data[4],
                                method: 'get',
                                success: function (success) {
                                    $('#transaction-body-modal').removeClass('loading-mask');
                                    if (success) {
                                        showDialogSuccessDeleted('Data deleted!');
                                        setTimeout(function () {
                                            window.location.reload();
                                        }, 1000)
                                    } else {
                                        showDialogErrorDeleted(result);
                                    }
                                }
                            });
                        } else {
                            $('#show-error').modal('show');
                            $('#transaction-body-modal').removeClass('loading-mask');
                        }
                    });
                });

                $('#show-error').modal('show');

            })
        }
    });
    $('#error-table tbody').addClass('member');

    let profile_user_img = $('.profile-user-img');
    let user_sid = profile_user_img.data('id');
    loadImage(profile_user_img, user_sid, $('#loading-image'));
    function loadImage(wrap, id, shimmer, shine) {
        let data = null;
        if (id == null) {
            wrap.css('cursor', 'not-allowed')
        } else {
            $.ajax({
                url: BASE_URL + 'user/image/' + id,
                method: 'get',
                success: function (result) {
                    const data = JSON.parse(result);
                    wrap.attr('src', 'data:image/jpeg;base64,' + openImage($(wrap), data.data_sid, data.data));
                },
                error: function (err) {
                    console.log(err);
                    wrap.hide();
                    wrap.attr('src', 'data:image/jpeg;base64,');
                    wrap.fadeIn();
                },
                complete: function () {
                    shimmer.fadeOut(100);
                    setTimeout(function () {
                        wrap.fadeIn(70);
                        wrap.css('display', 'block');
                    }, 200);
                }
            });
        }
        return data;
    }
});

function openImage(wrap, id, data) {
    if (data == null) {
        wrap.css('cursor', 'not-allowed');
        return ''
    } else {
        wrap.css('cursor', 'zoom-in');
        wrap.click(function () {
            window.open(BASE_URL + 'img/view/' + id);
        });
    }
    return data;
}